{
  "TASK_V3": {
    "mission": "M010",
    "command": "start_mission",
    "objective": "Acquire critical system performance logs and perform an initial anomaly scan.",
    "steps": [
      {
        "step_id": "1",
        "action": "connect_to_server",
        "target": "log_server_01",
        "protocol": "SSH",
        "credentials": "encrypted_key_M010"
      },
      {
        "step_id": "2",
        "action": "retrieve_logs",
        "log_type": ["system", "application"],
        "time_frame": "last_24_hours",
        "destination": "/tmp/M010_raw_logs/"
      },
      {
        "step_id": "3",
        "action": "run_script",
        "script_name": "log_parser.py",
        "input_directory": "/tmp/M010_raw_logs/",
        "output_directory": "/tmp/M010_parsed_logs/"
      },
      {
        "step_id": "4",
        "action": "analyze_data",
        "tool": "anomaly_detector.sh",
        "input_directory": "/tmp/M010_parsed_logs/",
        "output_report": "/tmp/M010_anomaly_report.json",
        "parameters": {
          "threshold": "high",
          "severity_level": "critical"
        }
      },
      {
        "step_id": "5",
        "action": "generate_summary_report",
        "report_type": "markdown",
        "source_file": "/tmp/M010_anomaly_report.json",
        "output_file": "M010_final_summary.md"
      },
      {
        "step_id": "6",
        "action": "disconnect_from_server",
        "target": "log_server_01"
      }
    ],
    "report": {
      "status": "pending",
      "files_to_submit": [
        "M010_final_summary.md",
        "/tmp/M010_anomaly_report.json"
      ]
    },
    "command_next": "end_mission"
  }
}
```

